import React from "react";
import { useLocation } from "react-router-dom";
function useQuery() {
  return new URLSearchParams(useLocation().search);
}

const Auth = () => {
  let query = useQuery();
  console.log(query.get("id"));
  return <div></div>;
};

export default Auth;
